'use strict';

/**
 * @fileOverview track g6
 * Experience improvement program
 */

var Monitor = require('@ali/g2-monitor');
var version = require('./version');
var config = {
  g6: true,
  version: version,
  page_type: 'syslog'
};

// delay to send the request
setTimeout(function () {
  if (Monitor.tracking) {
    var m = new Monitor();
    m.log(config);
  }
}, 100);

module.exports = config;